BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" text NOT NULL);
CREATE TABLE "loginusers" ("id" SERIAL PRIMARY KEY NOT NULL, "provider" text, "uid" text, "name" text, "oauth_token" text, "oauth_expires_at" timestamp, "created_at" timestamp, "updated_at" timestamp, "email" text, "password" text);
CREATE TABLE "pois" ("id" SERIAL PRIMARY KEY NOT NULL, "latitude" float, "longitude" float, "address" text, "description" text, "title" text, "user_id" integer, "sponsor" text, "total_ratings" integer, "total_people" integer, "avg_rating" integer);
','Paw Prints',8,'None',NULL,NULL,NULL);
CREATE TABLE "users" ("id" SERIAL PRIMARY KEY NOT NULL, "name" text, "email" text, "password" text, "created_at" timestamp, "updated_at" timestamp, "roles" text, "provider" text, "uid" text, "address1" text, "address2" text, "city" text, "state" text, "zip" integer, "phone1" integer, "phone2" integer, "phone3" integer, "age" integer, "sex" text, "bio" text, "website" text, "remember_me" text, "password_reset_token" text, "password_expires_after" timestamp, "salt" text, "is_approved" boolean);
CREATE TABLE "authorizations" ("id" SERIAL PRIMARY KEY NOT NULL, "provider" text, "uid" text, "user_id" integer, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "comments" ("id" SERIAL PRIMARY KEY NOT NULL, "user_id" text, "poi_id" text, "text" text, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "messages" ("id" SERIAL PRIMARY KEY NOT NULL, "subject" text, "body" text, "sender" text, "recipient" text, "has_read" boolean, "created_at" timestamp, "updated_at" timestamp);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
