INSERT INTO "pois" VALUES(78,33.585317,-8.50750549999999918816e+01,'710 Rome St, Carrollton, GA ‎','Spirit Wolf represents various aspects of the state of Georgia such as the red wolf, Georgia red clay, pine trees and the Blue Ridge Mountains.','Spirit Wolf ',8,'None',NULL,NULL,NULL);
INSERT INTO "pois" VALUES(79,33.577782,-85.0764109,'315 Bradley St, Carrollton, GA ‎','Just as a community is a combination of people, it is also made up of buildings, which eventually become landmarks. The buildings depicted upon this wolf are landmarks that hold many memories for people throughout Carrollton. ','Guidance',8,'Charlie and Sissy Almon',NULL,NULL,NULL);
INSERT INTO "pois" VALUES(80,33.570706,-85.1034311,'1601 Maple St, Carrollton, GA ','My design represents community because of what is represented in each of the paw prints. Each paw has its own identity, describing what Carrollton and the greater community is about.
INSERT INTO "pois" VALUES(81,33.57929,-85.0728649,'323 Newnan St, Carrollton, GA ‎','Maddie’s design was inspired by a lesson plan on Animal Art inspired by the works from Oaxaca, Mexico. She and her classmates were encouraged to explore shape, color and line to create their designs. ','Wolfie',5,'Greenway Medical Technologies Inc.',NULL,NULL,NULL);
INSERT INTO "pois" VALUES(82,33.570706,-85.1034311,'1601 Maple Street Carrollton, GA 30118','I have continued to carry on her tradition of collecting headlines and my wolf is designed as tribute to her.','Headlines',5,'Hungry Wolf',NULL,NULL,NULL);
INSERT INTO "pois" VALUES(83,33.5753922,-85.0993309,'325 W Georgia Dr, Carrollton, GA ‎','Brady’s design was inspired by a lesson plan on animal art inspired by the works from Oaxaca, Mexico. He and his classmates were encouraged to explore shape, color, and line to create their designs.','Howl',5,'Advantage Office Solutions',NULL,NULL,NULL);
